import React from 'react';
import pokemonList from './pokemon'; // ./ means check the current directory for this file
import './App.css';

function App() {
  return (
    <div>
      <h1>Pokedex</h1>
      {pokemonList.map(pokemon => {
        return <div>{pokemon.name}</div>
      })}
    </div>
  );
}

export default App;
